import "./contact.scss"
import { useEffect } from "react";
import Aos from 'aos';
import "aos/dist/aos.css";

const Contact = () => {
  useEffect(() => {
    Aos.init({duration: 1000});
  }, []);

  return (
    <div className="contact" id="contact">
        <h1>Contact</h1>
    </div>

  )
}

export default Contact
